/*Table structure for table `sys_organization` */

DROP TABLE IF EXISTS `sys_organization`;

CREATE TABLE `sys_organization` (
  `id` BIGINT(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `organ_code` VARCHAR(128) NOT NULL COMMENT '单位代码',
  `organ_name` VARCHAR(128) NOT NULL COMMENT '单位名称',
  `area_id` BIGINT(20) DEFAULT NULL COMMENT '所属区域id',
  `area_code` VARCHAR(128) DEFAULT NULL COMMENT '所属区域代码',
  `area_name` VARCHAR(128) DEFAULT NULL COMMENT '所属区域名称',
  `sort` BIGINT(20) DEFAULT NULL COMMENT '排序字段',
  `parent_id` BIGINT(20) DEFAULT NULL COMMENT '父节点id',
  `create_user_id` BIGINT(20) DEFAULT NULL COMMENT '创建人',
  `update_user_id` BIGINT(20) DEFAULT NULL COMMENT '修改人',
  `remark` VARCHAR(255) DEFAULT NULL COMMENT '备注',
  `del` TINYINT(1) DEFAULT '0' COMMENT '是否删除',
  `otype` VARCHAR(50) DEFAULT NULL COMMENT '单位类型',
  `lon` DECIMAL(6,6) DEFAULT NULL COMMENT '经度',
  `lat` DECIMAL(6,6) DEFAULT NULL COMMENT '纬度',
  `start_time` DATETIME DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '启用时间',
  `end_time` DATETIME DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '停用时间',
  `address` VARCHAR(255) DEFAULT NULL COMMENT '地址',
  `postcode` VARCHAR(255) DEFAULT NULL COMMENT '邮编',
  `email` VARCHAR(255) DEFAULT NULL,
  `fax` VARCHAR(255) DEFAULT NULL,
  `tel` VARCHAR(255) DEFAULT NULL,
  `brief_org` TEXT COMMENT '单位简介',
  `duty_org` TEXT COMMENT '职责',
  `brief_user` TEXT COMMENT '人员职责',
  PRIMARY KEY (`id`)
) ENGINE=INNODB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='组织和单位';

