/*Table structure for table `sys_sms` */

DROP TABLE IF EXISTS `sys_sms`;

CREATE TABLE `sys_sms` (
  `id` BIGINT(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sms_name` VARCHAR(200) NOT NULL COMMENT 'sms名称',
  `sms_template` VARCHAR(1000) DEFAULT NULL COMMENT 'sms模板（云上复制过来）',
  `sms_note` VARCHAR(1000) DEFAULT NULL COMMENT 'sms说明',
  `sms_user` VARCHAR(1000) DEFAULT NULL COMMENT 'sms发送名单（userids）',
  `sms_singname` VARCHAR(200) DEFAULT NULL COMMENT 'sms签名',
  `sms_code` VARCHAR(100) NOT NULL COMMENT 'smsCode 跟云上对应',
  PRIMARY KEY (`id`)
) ENGINE=INNODB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;

