/*Table structure for table `sys_store` */

DROP TABLE IF EXISTS `sys_store`;

CREATE TABLE `sys_store` (
  `id` BIGINT(20) NOT NULL AUTO_INCREMENT,
  `port` VARCHAR(10) DEFAULT NULL COMMENT 'port',
  `ip` VARCHAR(50) DEFAULT NULL COMMENT 'ip',
  `instance_user` VARCHAR(20) DEFAULT NULL COMMENT '用户名',
  `instance_pass` VARCHAR(200) DEFAULT NULL COMMENT '数据库密码',
  `instance_type` VARCHAR(50) DEFAULT NULL COMMENT '数据库类型',
  `corn` VARCHAR(100) DEFAULT NULL COMMENT '定时corn表达式',
  `database_name` VARCHAR(200) DEFAULT NULL COMMENT '数据库名称',
  `remark` VARCHAR(200) DEFAULT NULL COMMENT '备注',
  `active_time` TINYINT(2) DEFAULT '0' COMMENT '是否开启定时 0 不开启',
  PRIMARY KEY (`id`)
) ENGINE=INNODB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

